import React, { useState, useEffect, useRef } from 'react';

const AwarenessVideo = ({ content, onClose }) => {
  const [isPlaying, setIsPlaying] = useState(false);
  const [currentText, setCurrentText] = useState('');
  const synthRef = useRef(null);

  useEffect(() => {
    // Initialize speech synthesis
    if ('speechSynthesis' in window) {
      synthRef.current = window.speechSynthesis;
    }
    return () => {
      // Cancel any ongoing speech
      if (synthRef.current) {
        synthRef.current.cancel();
      }
    };
  }, []);

  const handlePlay = () => {
    if (!synthRef.current) {
      alert('Text-to-speech is not supported in your browser.');
      return;
    }

    setIsPlaying(true);
    const utterance = new SpeechSynthesisUtterance(content.video_script);
    utterance.rate = 0.9;
    utterance.pitch = 1;
    utterance.volume = 1;

    utterance.onend = () => {
      setIsPlaying(false);
    };

    utterance.onerror = () => {
      setIsPlaying(false);
    };

    synthRef.current.speak(utterance);
  };

  const handleStop = () => {
    if (synthRef.current) {
      synthRef.current.cancel();
      setIsPlaying(false);
    }
  };

  return (
    <div className="fixed inset-0 bg-black bg-opacity-75 flex items-center justify-center z-50 p-4">
      <div className="glassmorphism rounded-xl p-8 max-w-3xl w-full max-h-[90vh] overflow-y-auto">
        <div className="flex justify-between items-start mb-6">
          <div>
            <h2 className={`text-3xl font-bold mb-2 ${
              content.type === 'success' ? 'text-green-400' : 'text-yellow-400'
            }`}>
              {content.title}
            </h2>
            <p className="text-gray-300 text-lg">{content.message}</p>
          </div>
          <button
            onClick={onClose}
            className="text-gray-400 hover:text-white text-2xl"
          >
            √ó
          </button>
        </div>

        {/* Video/Audio Section */}
        <div className="bg-gray-800 rounded-lg p-6 mb-6">
          <div className="flex items-center justify-between mb-4">
            <h3 className="text-xl font-semibold text-white">üéì Awareness Training</h3>
            <div className="flex gap-2">
              {!isPlaying ? (
                <button
                  onClick={handlePlay}
                  className="px-4 py-2 bg-blue-600 hover:bg-blue-700 text-white rounded-lg font-semibold transition-all duration-200"
                >
                  üîä Play Audio
                </button>
              ) : (
                <button
                  onClick={handleStop}
                  className="px-4 py-2 bg-red-600 hover:bg-red-700 text-white rounded-lg font-semibold transition-all duration-200"
                >
                  ‚èπÔ∏è Stop
                </button>
              )}
            </div>
          </div>
          
          <div className="bg-gray-900 rounded p-4 mb-4">
            <p className="text-gray-200 leading-relaxed whitespace-pre-wrap">
              {content.video_script}
            </p>
          </div>
        </div>

        {/* Key Tips */}
        <div className="bg-gradient-to-r from-blue-900/50 to-purple-900/50 rounded-lg p-6">
          <h3 className="text-xl font-semibold text-white mb-4">üí° Key Takeaways</h3>
          <ul className="space-y-3">
            {content.tips && content.tips.map((tip, index) => (
              <li key={index} className="flex items-start space-x-3">
                <span className="text-blue-400 text-xl">‚úì</span>
                <span className="text-gray-200 flex-1">{tip}</span>
              </li>
            ))}
          </ul>
        </div>

        <div className="mt-6 text-center">
          <button
            onClick={onClose}
            className="px-8 py-3 bg-gradient-to-r from-blue-600 to-purple-600 hover:from-blue-700 hover:to-purple-700 text-white rounded-lg font-semibold transition-all duration-200 transform hover:scale-105"
          >
            Continue Training
          </button>
        </div>
      </div>
    </div>
  );
};

export default AwarenessVideo;
